INSERT INTO `RESOURCES` VALUES ('10','Window.Title',0,'Musikverein Angelbachtal e.V.'),('11','Ticket.Buttons',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    Openbravo POS is a point of sales application designed for touch screens.\n    Copyright (C) 2008-2009 Openbravo, S.L.\n    http://sourceforge.net/projects/openbravopos\n\n    This file is part of Openbravo POS.\n\n    Openbravo POS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    Openbravo POS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with Openbravo POS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n<configuration xmlns:xsi=\'http://www.w3.org/2001/XMLSchema-instance\'\n               xsi:noNamespaceSchemaLocation=\"Schema.Ticket.xsd\">\n\n    <button key=\"button.sendorder\" name=\"button.sendorder\" code=\"event.SendOrder\"/>\n    <button key=\"button.consolidate\" titlekey=\"button.consolidate\" code=\"do.consolidate\"/>\n    <button key=\"button.print\" titlekey=\"button.print\" template=\"/com/nordpos/templates/Printer.TicketPreview.xml\"/>\n    <button key=\"button.opendrawer\" titlekey=\"button.opendrawer\"\n            template=\"/com/nordpos/templates/Printer.OpenDrawer.xml\"/>\n\n    <event key=\"ticket.addline\" code=\"event.addline\"/>\n    <event key=\"ticket.removeline\" code=\"event.removeline\"/>\n    <event key=\"ticket.setline\" code=\"event.setline\"/>\n    <event key=\"ticket.total\" code=\"event.total\"/>\n\n    <!--\n        <event key=\"ticket.change\" code=\"event.change\"/>\n        <event key=\"ticket.show\" code=\"event.show\"/>\n        <event key=\"ticket.total\" code=\"event.total\"/>\n        <event key=\"ticket.close\" code=\"event.close\"/>\n    -->\n\n    <!--\n        <event key=\"ticket.addline\" code=\"Script.StockCurrentAdd\"/>\n        <event key=\"ticket.setline\" code=\"Script.StockCurrentSet\"/>\n    -->\n\n    <img-width value=\"96\"/>\n    <img-height value=\"96\"/>\n    <font-size value=\"12\"/>\n    <catvisible value=\"true\"/>\n    <cat-height value=\"256\"/>\n    <pricevisible value=\"true\"/>\n    <imageviewer value=\"false\"/>\n\n    <taxesincluded value=\"true\"/>\n\n    <attributesautoset value=\"true\"/>\n\n    <printselected value=\"true\"/>\n    <refmultcontrol value=\"true\"/>\n\n    <discount-rate-visible value=\"true\"/>\n    <discount-rate-1 value=\"5\"/>\n    <discount-rate-2 value=\"10\"/>\n    <discount-rate-3 value=\"15\"/>\n\n    <!--\n        <discount-money-visible value=\"true\"/>\n        <discount-money-1 value=\"1\"/>\n        <discount-money-2 value=\"5\"/>\n        <discount-money-3 value=\"10\"/>\n    -->\n\n    <!--    <price-is-zero value=\"true\"/> -->\n</configuration>\n'),('12','Ticket.Line',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    Openbravo POS is a point of sales application designed for touch screens.\n    Copyright (C) 2007-2009 Openbravo, S.L.\n    http://sourceforge.net/projects/openbravopos\n\n    This file is part of Openbravo POS.\n\n    Openbravo POS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    Openbravo POS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with Openbravo POS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n\n<line>\n    <column name=\"label.sendorder\" width=\"5\" align=\"left\" value=\"${ticketline.getProperty(\'printkb\',\'??\')}\"/> \n    <column name=\"label.sendstatus\" width=\"5\" align=\"left\" value=\"${ticketline.getProperty(\'sendstatus\',\'??\')}\"/>\n    <column name=\"label.item\" width=\"125\" align=\"left\"\n            value=\"&lt;html&gt;#if ($ticketline.isProductCom()) &lt;i&gt;*&amp;nbsp;&amp;nbsp;${ticketline.printName()}&lt;/i&gt; #else ${ticketline.printName()} #end&lt;br&gt;${ticketline.getProductAttSetInstDesc()}\"/>\n    <column name=\"label.price\" width=\"80\" align=\"right\" value=\"${ticketline.printPrice()}\"/>\n    <column name=\"label.discount\" width=\"50\" align=\"center\" value=\"${ticketline.printDiscountRate()}\"/>\n    <column name=\"label.units\" width=\"50\" align=\"right\" value=\"x${ticketline.printMultiply()}\"/>\n    <column name=\"label.tax\" width=\"50\" align=\"center\" value=\"${ticketline.printTaxRate()}\"/>\n    <column name=\"label.value\" width=\"80\" align=\"right\" value=\"${ticketline.printSubValue()}\"/>\n</line>'),('14','Menu.Root',0,'/**\r\n *\r\n * NORD POS is a fork of Openbravo POS.\r\n *\r\n * Copyright (C) 2009-2016 Nord Trading Ltd. <http://www.nordpos.com>\r\n *\r\n * This file is part of NORD POS.\r\n *\r\n * NORD POS is free software: you can redistribute it and/or modify it under the\r\n * terms of the GNU General Public License as published by the Free Software\r\n * Foundation, either version 3 of the License, or (at your option) any later\r\n * version.\r\n *\r\n * NORD POS is distributed in the hope that it will be useful, but WITHOUT ANY\r\n * WARRANTY; without even the implied warranty of MERCHANTABILITY or FITNESS FOR\r\n * A PARTICULAR PURPOSE. See the GNU General Public License for more details.\r\n *\r\n * You should have received a copy of the GNU General Public License along with