ked = currentAge;\n}\n\n\nint index = sales.getSelectedIndex();\nint minimumAge = Integer.parseInt(line.getProperty(\"Age\"));\n\nif(minimumAge != null && minimumAge > ageChecked && Integer.parseInt(line.getProperty(\"Age_Check\")) != 0) {\n    Calendar birthday = Calendar.getInstance();\n    String birthdayString = \"Geburtsdatum vor oder gleich: \" + birthday.get(Calendar.DATE) + \".\" + (birthday.get(Calendar.MONTH) + 1) + \".\"\n        + (birthday.get(Calendar.YEAR) - minimumAge);\n\n    java.awt.Toolkit.getDefaultToolkit().beep();\n    int option = JOptionPane.showConfirmDialog(null, \"Ist die Person über \" + minimumAge + \" Jahre alt?\\nBitte Ausweis überprüfen.\\n\" + birthdayString, \"Altersüberprüfung\", JOptionPane.YES_NO_OPTION);\n\n    if (option == 1) {\n        javax.swing.JLabel FontText = new javax.swing.JLabel();\n        FontText.setFont(new Font(\"Arial\", Font.BOLD, 18));\n        FontText.setText(\"KANN PRODUKT NICHT VERKAUFEN, KUNDE IST ZU JUNG! ERFORDERLICHES ALTER: \" + minimumAge);\n        javax.swing.JOptionPane.showMessageDialog(null,\n                FontText,\n                \"VERKAUF NICHT MÖGLICH\",\n                JOptionPane.WARNING_MESSAGE);\n        return \"Cancel\";\n    }\n}\n\n//Remove nulls for unknown products\nif (line.getProperty(\"printkb\") == null) {\n    line.setProperty(\"printkb\", \"N/A\");\n}\n\n//No need to send unknown products anywhere\nif (line.getProperty(\"sendstatus\") == null) {\n    line.setProperty(\"sendstatus\", \"Ja\");\n}'),('9','Window.Logo',1,'PNG\r\n\Z\n\0\0\0\rIHDR\0\0\06\0\0\06\0\0\0Ej\0\0IDATxڽZgXT^3v@*\"tޛ:QlQ*$J\'jcr5{DM1VLQq!7瓻gMsw޵!4a^d.#\0tzQZsGq}t֭gѾ=`<;@CGAqc\Z_ǞQ7GHI|~	s]HiIqT]UF5kmkVPzj%\',%[WQovkhM\rmkyTj4WFnlQٶ΋-@eJޚ%JW^kcJ{cJYg\ZPoOAWQ~.J:,!S#=\Zؿ^{Sk_V57o*%qEݹz7us+;gPq]Hz>9,?]L񮴦RgT^vF*\'۵q-AڸcrKZFX[u{_ܦ/?̛W3_$\\goO+vv.UqE0JRY*n[FFgu{BP\"f%ǫd{O[۾s\r\\}<]9wxʖyof$&\Z	Vx,?}\ZooQ >~7;3C\ZKRߜygKKHɲoNOMSL+t5