et.TicketInfo;\nimport com.openbravo.pos.ticket.TicketProductInfo; \nimport java.util.Properties;\n\nint numlines = ticket.getLinesCount(); \n\nfor (int i = 0 ; i < numlines ; i++) {\n 	current_ticketline = ticket.getLine(i);\n	current_unit  = current_ticketline.getMultiply();\n	if ( current_unit != 0 && current_ticketline.getPrice() != 0) {\n		for (int j = i + 1 ; j < numlines ; j++) {\n			loop_ticketline = ticket.getLine(j);\n			loop_unit  = loop_ticketline.getMultiply();\n 			String current_productid = current_ticketline.getProductID();\n			String loop_productid    = loop_ticketline.getProductID();\n\n				if (loop_productid.equals(current_productid) && (loop_ticketline.getPrice() == current_ticketline.getPrice()) && (loop_unit != 0)) {\n					current_unit = current_unit + loop_unit;\n					loop_ticketline.setMultiply(0);\n			}\n		}\n	current_ticketline.setMultiply(current_unit);\n	}	\n }\n\n\n// now remove the ticket lines where the unit = 0\n// start deleteing in reverse order\n\nfor (int i = numlines - 1 ; i > 0 ; i--) { \n	loop_ticketline = ticket.getLine(i);\n	loop_unit  = loop_ticketline.getMultiply();\n	if (loop_unit == 0){\n		ticket.removeLine(i);\n	}\n}\n\n//Stop payment when all items not sent\nfor (int i = 0; i < ticket.getLinesCount(); i++) {\n    line = ticket.getLine(i);\n\n\n    // Set Discount(printkb=NULL) to N/A so it does not error on next section.\n    if (line.getProperty(\"printkb\") == null) {\n        line.setProperty(\"printkb\", \"N/A\");\n    }\n    if (line.getProperty(\"sendstatus\") == null) {\n        line.setProperty(\"sendstatus\", \"Nein\");\n    }\n\n    if (line.getProperty(\"sendstatus\").equals(\"Nein\") || line.getProperty(\"sendstatus\").equals(\"Tilgen\")) {\n        mySent = \"Nein\";\n    }\n}\n\nif (mySent == \"Nein\") {\n    javax.swing.JOptionPane.showMessageDialog(null, \"Du musst erst alle Posten, vor der Zahlung, abschicken.\", \"Abschicken Warnung\", JOptionPane.WARNING_MESSAGE);\n    return \"Tilgen\";\n} else {\n    return null;\n}'),('d78e7533-08d6-4434-a7ff-84e4e78986a0','Laptop-jan/properties',0,'<?xml version=\"1.0\" encoding=\"UTF-8\" standalone=\"no\"?>\n<!DOCTYPE properties SYSTEM \"http://java.sun.com/dtd/properties.dtd\">\n<properties>\n<comment>NORD POS</comment>\n<entry key=\"taxcategoryid\">000</entry>\n<entry key=\"unitbarcode\">220</entry>\n<entry key=\"pricebarcode\">210</entry>\n<entry key=\"genbarcode\">true</entry>\n<entry key=\"genreference\">true</entry>\n<entry key=\"productcategoryid\">000</entry>\n<entry key=\"usercard\">344245</entry>\n<entry key=\"location\">0</entry>\n<entry key=\"userbarcode\">200</entry>\n<entry key=\"activecash\">44933324-a75b-4eaa-9c8b-995b96b2e230</entry>\n<entry key=\"customercard\">111111</entry>\n<entry key=\"productpricebarcode\">250</entry>\n</properties>\n'),('de2361f6-2f35-42d5-86ac-94b89257f05c','event.SendOrder',0,'//evalScript(\"do.consolidate\", null); !! Not working, dont know why so duplicate script part\nimport com.openbravo.format.Formats;\nimport com.openbravo.pos.ticket.TicketLineInfo;\nimport com.openbravo.pos.ticket.TicketInfo;\nimport com.openbravo.pos.ticket.TicketProductInfo; \nimport java.util.Properties;\n\nint numlines = ticket.getLinesCount(); \n\nfor (int i = 0 ; i < numlines ; i++) {\n 	current_ticketline = ticket.getLine(i);\n	current_unit  = current_ticketline.getMultiply();\n	if ( current_unit != 0 && current_ticketline.getPrice() != 0) {\n		for (int j = i + 1 ; j < numlines ; j++) {\n			loop_ticketline = ticket.getLine(j);\n			loop_unit  = loop_ticketline.getMultiply();\n 			String current_productid = current_ticketline.getProductID();\n			String loop_productid    = loop_ticketline.getProductID();\n\n				if (loop_productid.equals(current_productid) && (loop_ticketline.getPrice() == current_ticketline.getPrice()) && (loop_unit != 0)) {\n					current_unit = current_unit + loop_unit;\n					loop_ticketline.setMultiply(0);\n			}\n		}\n	current_ticketline.setMultiply(current_unit);\n	}	\n }\n\n\n// now remove the ticket lines where the unit = 0\n// start deleteing in reverse order\n\nfor (int i = numlines - 1 ; i > 0 ; i--) { \n	loop_ticketline = ticket.getLine(i);\n	loop_unit  = loop_ticketline.getMultiply();\n	if (loop_unit == 0){\n		ticket.removeLine(i);\n	}\n}\n//end duplicate consolidation script\n\n// Print an order ticket to the Kitchen & Bar\\Dessert\nboolean kitchen = false;\nboolean bar = false;\nboolean change_kitchen = false;\nboolean change_bar = false;\n\nfor (int i = 0; i < ticket.getLinesCount(); i++) {\n    line = ticket.getLine(i);\n\n    // Set Discount(printkb=NULL) to N/A so it does not error on next section.\n    if (line.getProperty(\"printkb\") == null) {\n        line.setProperty(\"printkb\", \"N/A\");\n    }\n    if (line.getProperty(\"sendstatus\") == null) {\n        line.setProperty(\"sendstatus\", \"Nein\");\n    }\n\n    if ((line.getProperty(\"printkb\").equals(\"Küche\")) && (line.getProperty(\"sendstatus\").equals(\"Nein\"))) {\n        kitchen = true; //There is something to print to kitchen\n    } else if ((line.getProperty(\"printkb\").equals(\"Bar\")) && (line.getProperty(\"sendstatus\").equals(\"Nein\"))) {\n        bar = true; //There is something to print to bar\n    } else if ((line.getProperty(\"printkb\").equals(\"Küche\")) && (line.getProperty(\"sendstatus\").equals(\"Tilgen\"))) {\n        change_kitchen = true; //There is something to change for kitchen\n    } else if ((line.getProperty(\"printkb\").equals(\"Bar\")) && (line.getProperty(\"sendstatus\").equals(\"Tilgen\"))) {\n        change_bar = true; //There is something to change for bar\n    }\n}\n\nif ((change_kitchen && kitchen) || (change_kitchen && !kitchen)) {\n    sales.printTicket(\"/com/nordpos/templates/Printer.TicketChange_Kitchen.xml\"); //Print changed kitchen items to kitchen printer\n}\nif ((change_bar && bar) || (change_bar && !bar)) {\n    sales.printTicket(\"/com/nordpos/templates/Printer.TicketChange_Bar.xml\"); //Print changed bar items to bar printer\n}\nif (kitchen && !change_kitchen) {\n    sales.printTicket(\"/com/nordpos/templates/Printer.TicketKitchen.xml\"); //Print kitchen items to kitchen printer\n}\nif (bar && !change_bar) {\n    sales.printTicket(\"/com/nordpos/templates/Printer.TicketBar.xml\"); //Print bar items to bar printer\n}\n\n//Show a nice message for confirmation\nif (kitchen && bar) {\n    javax.swing.JOptionPane.showMessageDialog(null, \"Deine Bestellung wurde an die Küche & Bar geschickt.\");\n} else if (kitchen && !bar) {\n    javax.swing.JOptionPane.showMessageDialog(null, \"Deine Bestellung wurde an die Küche geschickt.\");\n} else if (!kitchen && bar) {\n    javax.swing.JOptionPane.showMessageDialog(null, \"Deine Bestellung wurde an die Bar geschickt.\");\n} else if (change_kitchen || change_bar) {\n    javax.swing.JOptionPane.showMessageDialog(null, \"Deine Tilgungen wurden geschickt.\");\n} else {\n    javax.swing.JOptionPane.showMessageDialog(null, \"Es gibt nichts Neues zum Schicken\", \"Warnung\", JOptionPane.WARNING_MESSAGE);\n}\n\n//Set printkb property of item to Yes so it is not printed again\nfor (int i = ticket.getLinesCount() - 1; i >= 0; i--) {\n\n    line = ticket.getLine(i);\n    String a = line.getProperty(\"sendstatus\");\n    String b = \"Tilgen\";\n\n    if (((line.getProperty(\"printkb\").equals(\"Küche\")) || (line.getProperty(\"printkb\").equals(\"Bar\"))) && (line.getProperty(\"sendstatus\").equals(\"Nein\"))) {\n        line.setProperty(\"sendstatus\", \"Ja\");\n    }\n\n    //Remove cancelled lines\n    if (a.equals(b)) {\n        ticket.removeLine(i);\n    }\n}'),('f18a69ab-aec9-4466-85c5-f57a2b6df6f4','event.removeline',0,'// Set SendStatus and print removals\n\nline = ticket.getLine(index);\n\n//Remove nulls for unknown products\nif (line.getProperty(\"printkb\") == null) {\n    line.setProperty(\"printkb\", \"N/A\");\n}\n\n//No need to send unknown products anywhere\nif (line.getProperty(\"sendstatus\") == null) {\n    line.setProperty(\"sendstatus\", \"Nein\");\n}\n\nString a = line.getProperty(\"sendstatus\");\nString b = \"Ja\";\nString c = \"Nein\";\nInteger myCount = 0;\n//get count of auxiliar after the main product\nfor (i = index + 1; i < ticket.getLinesCount(); i++) {\n    if (ticket.getLine(i).isProductCom()) {\n        myCount = myCount + 1;\n    } else {\n        break;\n    }\n}\n\n//Set SendStatus of sent items to Cancel\nif (a.equals(b) && !line.isProductCom()) {\n    for (i = index + myCount; i >= index; i--) {\n        if (ticket.getLine(i).isProductCom() && ticket.getLine(i).getProperty(\"sendstatus\").equals(\"Ja\")) {\n            ticket.getLine(i).setProperty(\"sendstatus\", \"Tilgen\");\n        } else if (ticket.getLine(i).isProductCom() && ticket.getLine(i).getProperty(\"sendstatus\").equals(\"Nein\")) {\n            ticket.removeLine(i);\n        } else {\n            break;\n        }\n    }\n    line.setProperty(\"sendstatus\", \"Tilgen\");\n}\n\n//Removelines of NOT sent items\nif (a.equals(c) && !line.isProductCom()) {\n    for (i = index + myCount; i >= index; i--) {\n        if (ticket.getLine(i).isProductCom()) {\n            ticket.removeLine(i);\n        } else {\n            break;\n        }\n    }\n    ticket.removeLine(index);\n} else if (a.equals(c) && line.isProductCom()) {\n    ticket.removeLine(index);\n}\n\n//Cancel event\nremoveLine.cancel = true;'),('fd837d13-9abe-4a8c-88e9-396582bee44f','event.setline',0,'// Set Discount(printkb=NULL) to N/A so it does not error on next section.\nif (line.getProperty(\"printkb\") == null) {\n    line.setProperty(\"printkb\", \"N/A\");\n}\nif (line.getProperty(\"sendstatus\") == null) {\n    line.setProperty(\"sendstatus\", \"Nein\");\n}\n\n//Stop the line modification of sent products\nif (!line.getProperty(\"sendstatus\").equals(\"Nein\")) {\n    JOptionPane.showMessageDialog(null,\n            \"Du kannst ein abgeschicktes Produkt nicht ändern.\",\n            \"Fehler\",\n            JOptionPane.ERROR_MESSAGE);\n} else {\n    ticket.setLine(index, line);\n}\ncancel = true;');
